import React from "react";

function Navbar() {
    return (
      <div>
        <div className="container">
          <div className="navbar navbar-expand-lg navbar-light bg-light">
            <div className="container-fluid">
              <a className="navbar-brand"></a>
            </div>
          </div>
        </div>
      </div>
    )
}

export default Navbar;
